import React, { Component } from 'react';
import axios from "axios";
import {Bar, Line, Pie} from "react-chartjs-2";
import "chartjs-plugin-annotation";


class Chart extends Component {
    render(){
        const data = ['1,2,3,4,5']
       const options = {
                          annotation: {
                               annotations: [{
                                   drawTime: 'afterDatasetsDraw',
                                   borderColor: 'red',
                                   borderDash: [2, 2],
                                   borderWidth: 2,
                                   mode: 'vertical',
                                   type: 'line',
                                   value: 10,
                                   scaleID: 'x-axis-0',
                                   label: {
                                        backgroundColor: 'red',
                                        fontFamily: 'sans-serif',
                                        fontSize: 10,
                                        fontStyle: 'bold',
                                        fontColor: '#fff',
                                        textAlign: 'center',
                                        xPadding: 4,
                                        yPadding: 4,
                                        cornerRadius: 4,
                                        position: 'top',
                                        enabled: true,
                                        content: "Threshold"
                                    }
                             }]
                          },
                          maintainAspectRation: false
                      };
      return(
             <Bar
	         data={'1.2'}
	         width={100}
	         height={50}
	         options={options}
             />
       )
     }
}
export default Chart;
